import React, { Component} from 'react';
import axios from 'axios';

export default class Form extends Component {

    componentDidMount() {
        const url = 'http://localhost:8080/couriers';
        const response = axios.get(url);
        alert(response);

        fetch('/api/hello')
        .then(response => response.text())
        .then(message => {
            alert(message);
        });
    }

    render(){
        return(
            <div>
                all
